				# if len(nums) >= 2:
				# 	assert nums[1] in task_pipeline.MONTHS
				# 	task_pipeline.start_month = nums[1]
				# if len(nums) == 3:
				# 	assert nums[2] in task_pipeline.DAYS
				# 	task_pipeline.start_day = nums[2]
				task_pipeline.task_year = date
