class ProxyPipeline(object):

	MAX_FAILS = 1

	def __init__(self, db_path):
		self.db_conn = sqlite3.connect(db_path + '/proxies.db')
		self.db_cur = self.db_conn.cursor()
		self.db_cur.execute('''CREATE TABLE IF NOT EXISTS "proxies" (
			"id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
			"ip" TEXT(16) NOT NULL,
			"port" INTEGER NOT NULL DEFAULT 80,
			"protocol" TEXT(10) NOT NULL DEFAULT http,
			"fails" INTEGER NOT NULL DEFAULT 0,
			"valid" INTEGER NOT NULL DEFAULT 1,
			"lastupdate" TEXT(30),
			"source" TEXT(50)
			);''')
		self.db_cur.execute("delete from proxies where fails > {} or valid = 0".format(self.MAX_FAILS))
		self.db_conn.commit()

	@classmethod
	def from_crawler(cls, crawler):
		db_path = crawler.settings.get('DB_PATH')
		if not db_path:
			raise Exception('DB_PATH not configured!')

		return cls(db_path)

	def process_item(self, item, spider):
		if not isinstance(item, ProxyItem):
			return item

		sql = "select id, ip from proxies where ip = ?"
		self.db_cur.execute(sql, (item.get('ip', ''),))
		proxy = self.db_cur.fetchone()

		if not (proxy is None):
			sql = "update proxies set port = ?, protocol = ?, fails = 0, valid = 1, lastupdate = ?, source = ? where ip = ?"
			self.db_cur.execute(sql, (item.get('port', 80), item.get('protocol', 'http'), datetime.now(), item.get('ip', ''), item.get('source', '')))
			self.db_conn.commit()
		else:
			values = (item.get('ip', ''), item.get('port', 0), item.get('protocol', ''), 0, 1, datetime.now(), item.get('source', ''))
			sql = 'insert into proxies (ip, port, protocol, fails, valid, lastupdate, source) values (?, ?, ?, ?, ?, ?, ?)'
			self.db_cur.execute(sql, values)
			self.db_conn.commit()

		return item


	def all_proxies(self):
		self.db_cur.execute('select id, ip, port, protocol, fails, valid, lastupdate, source from proxies where fails <= {}'.format(self.MAX_FAILS))
		return self.db_cur.fetchall()

	def available_proxies(self):
		self.db_cur.execute('select id, ip, port, protocol, fails, valid, lastupdate, source from proxies where valid = 1')
		rows = self.db_cur.fetchall()
		proxies = []
		for row in rows:
			proxies.append({'ip': row[1], 'port': row[2], 'protocol': row[3]})
		return proxies


	def fail(self, ip):
		self.db_cur.execute("update proxies set fails = fails + 1, valid = 0 where ip = '{}'".format(ip))
		self.db_conn.commit()

	def open_spider(self, spider):
		spider.proxy_pipline = self

	def close_spider(self, spider):
		self.db_conn.commit()
		self.db_conn.close()
